import '../App.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import {NavBar} from '../components/NavBar';
import {Banner} from '../components/Banner'


function HomePage() {
    return(
        
        <div className="App">
            <NavBar />
            <Banner />

        </div>
        
    )
}

export default HomePage;
